import { Logger } from "@tsed/logger";
import { registerProvider } from "../registries/ProviderRegistry.js";
import { InjectorService } from "./InjectorService.js";
registerProvider({
    provide: Logger,
    deps: [InjectorService],
    useFactory(injector) {
        return injector.logger;
    }
});
